import React from "react";


export type ButtonRestartProps = {
  setGame: () => void;
};

const ButtonRestart: React.FC<ButtonRestartProps> = buttonRestartProps => {
    return (
    <button onClick={setGame} children="Reset"></button>
  );
};

export default ButtonRestart;
